package Patterns;

public class Pattern5 {
	//output
//	11111
//	22222
//	33333
//	44444
//	55555

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<5;i++)
		{
			for(int j=0;j<5;j++)
			{
				System.out.print(i+1);
			}
			System.out.println();
		}

	}

}
